nt-size: 15.0px; line-height: 150.0%; text-align: left; padding-to1: 9px; padding-right: 18px; padding-bottom: 9px; padding-left: 18px;&amp;quot;&amp;gt;&amp;lt;p&amp;gt;&amp;lt;span style=&amp;quot;line-height: 150%;&amp;quot;&amp;gt;&amp;lt;br&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;span style=&amp;quot;line-height: 150%;&amp;quot;&amp;gt;Somos una empresa que trabaja únicamente con materia prima renovable. Plantamos nuestros propios árboles que, durante décadas, ayudan a reducir el impacto de los seres humanos en la naturaleza:&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;Fijan el carbono. Estamos implantando árboles de crecimiento rápido que absorben durante 20 años CO2 de la atmósfera.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Sustituyen el uso de maderas nativa.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Favorecen a la recuperación de suelos degradados o erosionados.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Regenera el horizonte orgánico en el suelo.&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Protegen los recursos hídricos.&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Sillón Adirondack&amp;amp;nbsp;&amp;lt;/strong&amp;gt;&amp;lt;br&amp;gt;&amp;amp;nbsp;&amp;lt;br&amp;gt;&amp;lt;strong&amp;gt;Características:&amp;lt;/strong&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;&amp;lt;/strong&amp;gt;Madera maciza de Eucalyptus Rostrata. Viene desarmado en kit con herramientas para armar (fácil armado en 5 minutos). Resistente a la intemperie.&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;strong&amp;gt;Medidas: &amp;lt;/strong&amp;gt;&amp;lt;span style=&amp;quot;line-height: 150%;&amp;quot;&amp;gt;Altura total: 92cm Ancho total: 78cm. Asiento: Alto 35cm cm Ancho 55cm.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;&amp;lt;p&amp;gt;&amp;lt;span style=&amp;quot;line-height: 150%;&amp;quot;&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;strong&amp;gt;Peso:&amp;lt;/strong&amp;gt;14,5 Kg.&amp;lt;/p&amp;gt;&amp;lt;p&