 a la pelea o torneo del deporte que practiques:&amp;lt;/p&amp;gt;&amp;lt;ul&amp;gt;&amp;lt;li&amp;gt;MMA&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Taekwondo&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Karate&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Lucha&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Esgrima&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Boxeo&amp;lt;/li&amp;gt;&amp;lt;li&amp;gt;Kick Boxing&amp;lt;/li&amp;gt;&amp;lt;/ul&amp;gt;	&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt; &amp;lt;/div&amp;gt;	&amp;lt;/section&amp;gt;','','','','',''),(241,1,'Parrilla Tambor Chulengo Tapa Corrediza','&amp;lt;p&amp;gt;parrilla tambor chulengo con tapa corrediza&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;El emparrillado esta hecho de maya que mide 43 x 75 cm.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;La parrilla mide de ancho 1,60 mtros, teniendo en cuenta el brasero y la mesa extendida,de alto mide 1,36 mtros, su profundidad es de 0,65 cm.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;El brasero mide 0,30 cm de ancho x 0,30&amp;amp;nbsp; cm de alto y 0,45 cm&amp;amp;nbsp;de profundidad.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;La mesa mide 0,40 x 0,40 cm aprox.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;La parrilla esta pintada completamente con pintura&amp;amp;nbsp;para alta temperatura.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;El empearrilado es regulable con una manija y un sistema criquet.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;La mesa es rebatible hacia abajo para una mayor comodidad, y se encuantra barnizada.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;El brasero es desmontable.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;La parrilla viene con ladrillos refractarios REALES.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;Las patas estan hechas de un ca&amp;amp;ntilde;o rectangular de 1,2 mm&amp;amp;nbsp;de espesor,muy resistente y traen ruedas para su traslado.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;Toda la parrilla esta hecha con materiales de 1ra calidad, y enteramente soldada con MIG que le da una mayor resistencia comparada con otras soldadoras.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;La parrilla viene con PALITA Y ATIZADOR.&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\n\n&amp;lt;p&amp;gt;PREGUNTE POR CUALQUIER TIPO DE MODIFICACION,TANTO DE TAMA&amp;amp;Ntilde;O COMO MODELO,CONSULTAR PRIMERO POR STOCK ANTES DE OFERTAR.&amp;lt;/p&amp;gt;\n','','','','',''),(243,1,'Masajes a Domicilio','&amp;lt;p&amp;gt;testeando datos&amp;lt;/p&amp;gt;\n','','','','',''),(244,1,'Remera Roja','&amp;lt;p&amp;gt;terminando un test&amp;amp;nbsp;&amp;lt;/p&amp;gt;\n','','','','',''),(245,1,'Auricular Usb Headset Logitech H390 Reseller Oficial','&amp;lt;div id=&amp;quot;itemDescription&amp;quot; class=&amp;quot;description &amp;quot;&amp;gt;	&amp;lt;div class=&amp;quot;&amp;quot;&amp;gt;	&amp;lt;table width=&amp;quot;900&amp;quot; border=&amp;quot;0&amp;quot; cellpadding=&amp;quot;0&amp;quot; cellspacing=&amp;quot;0&amp;quot;&amp;gt;&amp;lt;tbody&amp;gt;&amp;lt;tr&amp;gt;&amp;lt;td&amp;gt;&amp;lt;img src=&amp;quot;http://www.electroshows.com.ar/images/imgml/imgcom/01.jpg&amp;quot; data-src-original=&amp;quot;http://www.electroshows.com.ar/images/imgml/imgcom/01.jpg&amp;quot; class=&amp;quot;src-lazy-load&amp;quot;&amp;gt;&amp;lt;/td&amp;gt;&amp;lt;/tr&amp;gt;&amp;lt;tr&amp;gt;&amp;lt;td&amp;gt;&amp;lt;img src=&amp;quot;http://www.electroshows.com.ar/images/imgml/imgcom/02.jpg&amp;quot; border=&amp;quot;0&amp;quot; usemap=&amp;quot;#Map&amp;quot; data-src-original=&amp;quot;http://www.electroshows.com.ar/images/imgml/imgcom/02.jpg&amp;quot; class=&amp;quot;src-lazy-load&amp;quot;&amp;gt;&amp;lt;/td&amp;gt;&amp;lt;/tr&amp;gt;&amp;lt;tr&amp;gt;&amp;lt;td&amp;gt;&amp;lt;img src=&amp;quot;http://www.electroshows.com.ar/images/imgml/imgcom/03.jpg&amp;quot; data-src-original=&amp;quot;http://www.electroshows.com.ar/images/imgml/imgcom/03.jpg&amp;quot; class=&amp;quot;src-lazy-load&amp;quot;&amp;gt;&amp;lt;/td&amp;gt;&amp;lt;/tr&amp;gt;&amp;lt;tr&amp;gt;&amp;lt;td&amp;